</p><p>PRESIDIO OF MONTEREY, Calif. -- Soldiers from Presidio's 229th Military Intelligence Battalion came out to represent the Army and witness the 3-M Celebrity Challenge charity event at Pebble Beach Golf Links, Feb. 8. The event was part of the AT&amp;T Pebble Beach Pro-Am and held one day prior to the start of the PGA tournament. The celebrity challenge is played over five holes with twelve celebrities paired in teams and playing alternate-shot format for a total purse of $100,000 to celebrities' designated charities. Participating celebrities were Bill Murray,  Huey Lewis, Larry the Cable Guy, Toby Keith, Kenny G, Clay Walker, Alfonso Ribeiro, Gary Mule Deer, Andy Garcia, Kelly Rohrbach, Kunal Nayyar, and Josh Duhamel.
</p><p>&lt;a href="<a rel="nofollow" class="external free" href="http://www.monterey.army.mil">http://www.monterey.army.mil</a>" rel="noreferrer nofollow"&gt;Official Presidio of Monterey Web site&lt;/a&gt;
</p><p>&lt;a href="<a rel="nofollow" class="external free" href="https://www.facebook.com/USAGPresidio">http://www.facebook.com/USAGPresidio</a>" rel="noreferrer nofollow"&gt;Official Presidio of Monterey Facebook&lt;/a&gt;
</p>
